import React from "react";
import { useGlobalContext } from "./context";

const Movies = () => {
  const { movie } = useGlobalContext();
  return (
    <>
      <section className="movie-page">
        <div className="grid grid-4-col"></div>
      </section>
      {movie.map((curMovie) => {
        return (
          <div>
            <h2>{curMovie.Title}</h2>
          </div>
        );
      })}
    </>
  );
};

export default Movies;
